import React from 'react';
import { Link } from 'react-router-dom';

const PropertyCard = ({ property }) => {
  const { _id, images, location, description, bedrooms, bathrooms, parking, price } = property;

  return (
    <Link to={`/property/buy/${_id}`} className="block rounded-lg shadow-lg overflow-hidden">
      <img src={images[0]} alt={location.address} className="w-full h-48 object-cover" />
      <div className="p-4">
        <h3 className="text-lg font-semibold text-gray-900">{location.address}</h3>
        <p className="mt-2 text-gray-600">{description.substring(0, 100)}...</p>
        <div className="mt-4 flex items-center">
          <div className="flex items-center mr-4">
            <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" strokeWidth={1.5} stroke="currentColor" className="w-5 h-5 text-gray-500">
              <path strokeLinecap="round" strokeLinejoin="round" d="M2.25 12l8.954-8.955c.44-.439 1.152-.439 1.591 0L21.75 12M4.5 9.75v10.125c0 .621.504 1.125 1.125 1.125H9.75v-4.875c0-.621.504-1.125 1.125-1.125h2.25c.621 0 1.125.504 1.125 1.125v4.875H16.5a1.125 1.125 0 001.125-1.125V9.75M8.25 4.5v-.75C8.25 2.542 6.998 1.25 5.75 1.25H1.5a1.125 1.125 0 00-1.125 1.125v.75C.375 4.5 1.5 5.625 2.625 5.625h16.875c1.125 0 2.25-.125 2.25-1.125v-.75A1.125 1.125 0 0021 3.375H5.75A1.125 1.125 0 004.625 4.5v.75z" />
            </svg>
            <span className="ml-1 text-gray-700">{bedrooms}</span>
          </div>
          <div className="flex items-center mr-4">
            <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" strokeWidth={1.5} stroke="currentColor" className="w-5 h-5 text-gray-500">
              <path strokeLinecap="round" strokeLinejoin="round" d="M12 16.5v-13.5l-7 4.5m14 0l-7-4.5" />
            </svg>
            <span className="ml-1 text-gray-700">{bathrooms}</span>
          </div>
          {parking && (
            <div className="flex items-center">
              <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" strokeWidth={1.5} stroke="currentColor" className="w-5 h-5 text-gray-500">
                <path strokeLinecap="round" strokeLinejoin="round" d="M15.75 6a3.75 3.75 0 11-7.5 0 3.75 3.75 0 017.5 0zM4.501 20.118a7.5 7.5 0 1114.998 0A17.933 17.933 0 0112 21.75c-2.676 0-5.216-.584-7.499-1.632z" />
              </svg>
            </div>
          )}
        </div>
        <p className="mt-4 text-lg font-semibold text-gray-900">${price}</p>
      </div>
    </Link>
  );
};

export default PropertyCard;
